import banner from "../images/icons/banner.png";
import { Link } from "react-router-dom";

const Home = () => {
  return <main>
    <div className="flex">
      <img src={banner} alt="" />
      <div>
      <h1>Besoin d'aide?</h1>
      <p>Trouver un bricoleur proche de chez vous!</p>
      <Link to="/"><button>Trouver un Bricoleur</button></Link>
      </div>
    </div>
  </main>;
};

export default Home;
